        <div className="mt-5">
            <div className="container">
                <input
                    onChange={(e) => setInp(e.target.value)}
                    className="form-control"
                    type="text"
                    placeholder="Search for movies or series"
                    readonly
                />
            </div>
        </div>
    );
};

export default Search;
